import "./App.scss";
import { ProjectComponent } from "./pages/comp/ProjectComponent";
import { LandingPage } from "./pages/LandingPage";
import { Navbar } from "./pages/Navbar";
import { Route, BrowserRouter as Router, Switch, Link } from "react-router-dom";

function App() {
  return (
    // <Router>
    //   <div className="App">
    //     <Navbar />
    //     <LandingPage />
    //     <Link to="/">Home</Link>
    //     <Link to="/portfolio">portfolio</Link>

    //     {/* <ProjectComponent /> */}
    //   </div>
    //   {/* <Route path="/" component={LandingPage} /> */}
    //   <Route path="/portfolio" component={ProjectComponent} />
    // </Router>
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/topics">Topics</Link>
          </li>
        </ul>

        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/topics">
            <Topics />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
